INSERT INTO `page` VALUES (1,1,0,0,2,0,'O Firmie','<section class=\"service\" id=\"service\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"main_service p_t__b textwhite\">\r\n<div class=\"head_title text-center textblack\">\r\n<h2>Witamy na Stronie BFZ</h2>\r\n\r\n<p>BFZ jest pionierem pod względem wprowadzania nowoczesnych technologii produkcji w branży pomocy drogowych do 5 Ton. Firma rozwija własną myśl technologiczną, optymalizuje proces produkcyjny, wprowadza nowości techniczne. Zespół konstruktorów i technologów opracowuje innowacyjne rozwiązania konstrukcyjne.</p>\r\n\r\n<div class=\"separator\">&nbsp;</div>\r\n</div>\r\n<!-- B4 -->\r\n\r\n<div class=\"col-sm-6\">\r\n<div class=\"single_service margin-top-40\">\r\n<div class=\"row\">\r\n<div class=\"col-sm-12\">\r\n<div class=\"single_text_icon text-center\"><img alt=\"\" class=\"img-responsive\" src=\"/filemanager/files/grafika/home/zdj2_1.jpg\" /></div>\r\n</div>\r\n&nbsp;\r\n\r\n<div class=\"col-sm-12\">\r\n<div class=\"single_service_text_right textblack\">\r\n<h6>Firma</h6>\r\n\r\n<p style=\"text-align: justify;\">Firma jest od początku istnienia związana z branżą motoryzacyjną, na potrzeby której projektuje i produkuje zabudowy aluminiowe do przewozu pojazdów. Firma posiada referencje w kręgu krajów Europy.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<!-- B4 --><!-- B1 -->\r\n\r\n<div class=\"col-sm-6\">\r\n<div class=\"single_service margin-top-40\">\r\n<div class=\"row\">\r\n<div class=\"col-sm-12\">\r\n<div class=\"single_text_icon text-center\"><img alt=\"\" class=\"img-responsive\" src=\"/filemanager/files/grafika/home/zdj2_2.jpg\" /></div>\r\n</div>\r\n&nbsp;\r\n\r\n<div class=\"col-sm-12\">\r\n<div class=\"single_service_text_right textblack\">\r\n<h6>Proces produkcyjny</h6>\r\n\r\n<p style=\"text-align: justify;\">Spawacze BFZ jedni z najlepszych fachowców techniki połączeń spawanych,&nbsp; profesjonaliści&nbsp; wykonujący spoiny łączenia metodami Tig, Mig. Uczciwość, rzetelność i profesjonalne podejście do każdego zadania to główne cechy naszego zespołu produkcyjnego.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<!-- B1 --><!-- B2 -->\r\n\r\n<div class=\"col-sm-6\">\r\n<div class=\"single_service margin-top-40\">\r\n<div class=\"row\">\r\n<div class=\"col-sm-12\">\r\n<div class=\"single_text_icon text-center\"><img alt=\"\" class=\"img-responsive\" src=\"/filemanager/files/grafika/home/zdj2_3.jpg\" style=\"width: 582px; height: 302px;\" /></div>\r\n</div>\r\n&nbsp;\r\n\r\n<div class=\"col-sm-12\">\r\n<div class=\"single_service_text_right textblack\">\r\n<h6>Materiały do produkcji</h6>\r\n\r\n<p style=\"text-align: justify;\">Do produkcji platform używamy wyłącznie <strong>aluminium i stali nierdzewnej</strong> dzięki takiemu rozwiązaniu produkty nasze są przez cały okres użytkowania bez śladów rdzy i korozji.&nbsp;</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<!-- B2 --><!-- B3 -->\r\n\r\n<div class=\"col-sm-6\">\r\n<div class=\"single_service margin-top-40\">\r\n<div class=\"row\">\r\n<div class=\"col-sm-12\">\r\n<div class=\"single_text_icon text-center\"><img alt=\"\" class=\"img-responsive\" src=\"/filemanager/files/grafika/home/zdj2_4.jpg\" style=\"width: 582px; height: 302px;\" /></div>\r\n</div>\r\n&nbsp;\r\n\r\n<div class=\"col-sm-12\">\r\n<div class=\"single_service_text_right textblack\">\r\n<h6>Projektowanie</h6>\r\n\r\n<p style=\"text-align: justify;\">Zespół konstruktorów i technologów opracowuje innowacyjne rozwiązania konstrukcyjne. Dzięki temu jesteśmy pionierami w wdrażaniu praktycznych rozwiązań dla użytkownika pojazdu.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<!-- B3 --></div>\r\n</div>\r\n</div>\r\n</section>\r\n','',0.00,'','','','','o-firmie','homeView.html','2016-11-28 10:59:05',1000,0,1),(2,1,0,0,2,0,'O Firmie','<section class=\"service\" id=\"service\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"main_service p_t__b textwhite\">\r\n<div class=\"head_title text-center textblack\">\r\n<h2>BFZ stawia na innowację !</h2>\r\n\r\n<p>BFZ jest pionierem pod względem wprowadzania nowoczesnych technologii produkcji w branży pomocy drogowych do 3,5Tony. Firma rozwija własną myśl technologiczną, optymalizuje proces produkcyjny, wprowadza nowości techniczne.</p>\r\n\r\n<div class=\"separator\">&nbsp;</div>\r\n</div>\r\n\r\n<div class=\"col-sm-6\">\r\n<div class=\"single_service margin-top-40\">\r\n<div class=\"row\">\r\n<div class=\"col-xs-2\">\r\n<div class=\"single_text_icon text-center\"><i class=\"fa fa-thumbs-o-up\"></i></div>\r\n</div>\r\n\r\n<div class=\"col-xs-10\">\r\n<div class=\"single_service_text_right textblack\">\r\n<h6>Innowacyjność</h6>\r\n\r\n<p>Zespół konstruktorów i technologów opracowuje innowacyjne rozwiązania konstrukcyjne.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<!--End of col-sm-6 --></div>\r\n\r\n<div class=\"col-sm-6\">\r\n<div class=\"single_service margin-top-40\">\r\n<div class=\"row\">\r\n<div class=\"col-xs-2\">\r\n<div class=\"single_text_icon text-center\"><i class=\"fa fa-thumbs-o-up\"></i></div>\r\n</div>\r\n\r\n<div class=\"col-xs-10\">\r\n<div class=\"single_service_text_right textblack\">\r\n<h6>Solidność</h6>\r\n\r\n<p>BFZ to solidny i wiarygodny producent zabudów samochodowych. Swoją pozycję zawdzięcza długoterminowym działaniom nastawionym na innowacyjność, doskonalenie procesów i ciągłe podnoszenie jakości.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<!--End of col-sm-6 --></div>\r\n\r\n<div class=\"col-sm-6\">\r\n<div class=\"single_service margin-top-40\">\r\n<div class=\"row\">\r\n<div class=\"col-xs-2\">\r\n<div class=\"single_text_icon text-center\"><i class=\"fa fa-thumbs-o-up\"></i></div>\r\n</div>\r\n\r\n<div class=\"col-xs-10\">\r\n<div class=\"single_service_text_right textblack\">\r\n<h6>Rozwój</h6>\r\n\r\n<p>Kluczowym elementem naszego rozwoju jest dążenie do ciągłego rozwoju</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<!--End of col-sm-6 --></div>\r\n\r\n<div class=\"col-sm-6\">\r\n<div class=\"single_service margin-top-40\">\r\n<div class=\"row\">\r\n<div class=\"col-xs-2\">\r\n<div class=\"single_text_icon text-center\"><i class=\"fa fa-thumbs-o-up\"></i></div>\r\n</div>\r\n\r\n<div class=\"col-xs-10\">\r\n<div class=\"single_service_text_right textblack\">\r\n<h6>Silna Pozycja</h6>\r\n\r\n<p>Sprawdzona strategia umożliwia naszej firmie dalsze umacnianie pozycji na rynku europejskim.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<!--End of col-sm-6 --></div>\r\n</div>\r\n</div>\r\n</div>\r\n</section>\r\n','ais.jpg',0.00,'','','','','ofirmie','fullView.html','2016-12-27 08:42:00',1000,0,0),(3,1,0,0,2,0,'Polityka Prywatności','<div class=\"container\">\r\n<h2>Dane zbierane automatycznie</h2>\r\n\r\n<p>Podczas Twojej wizyty na naszej stronie internetowej, automatycznie zbierane są dane dotyczące Twojej wizyty, np. Twój adres IP, nazwa domeny, typ przeglądarki, typ systemu operacyjnego, itp.</p>\r\n\r\n<h2>Dane zbierane, gdy kontaktujesz się z nami</h2>\r\n\r\n<p>Gdy kontaktujesz się z nami za pomocą strony internetowej, telefonu, poczty email, itp. przekazujesz nam swoje dane osobowe, np. imię, nazwisko, adres email, itp.</p>\r\n\r\n<h2>W jaki sposób wykorzystujemy Twoje dane?</h2>\r\n\r\n<p>W żadnym wypadku nie będziemy sprzedawali danych zebranych o Tobie podmiotom trzecim.</p>\r\n\r\n<p>Dane zbierane podczas rejestracji będą wykorzystane wyłącznie do umożliwienia Tobie zalogowania się do naszego systemu.</p>\r\n\r\n<p>Jeżeli zapisałeś się na nasz Newsletter, lub w inny sposób wyraziłeś zgodę na jego otrzymywanie, wykorzystamy Twoje dane w celu wysłania Ci naszego Newslettera. Zostaniesz zapytany czy chcesz otrzymywać Newsletter podczas rejestracji.</p>\r\n\r\n<p>Dane zbierane automatycznie mogą być użyte do analizy zachowań użytkowników na naszej stronie internetowej, zbierania danych demograficznych o naszych użytkownikach, lub do personalizacji zawartości naszych stron internetowych. Dane te są zbierane automatycznie o każdym użytkowniku. Dane zbierane w trakcie korespondencji pomiędzy Tobą, a naszym serwisem będą wykorzystane wyłącznie w celu odpowiedzi na Twoje zapytanie.</p>\r\n\r\n<p>W przypadku kontroli Generalnego Inspektoratu Ochrony Danych Osobowych, Twoje dane mogą zostać udostępnione pracownikom Inspektoratu zgodnie z ustawą o ochronie danych osobowych.</p>\r\n\r\n<p>W przypadku naruszenia Regulaminu naszego serwisu, naruszenia prawa, lub gdy będą wymagały tego przepisy prawa, możemy udostępnić Twoje dane organom wymiaru sprawiedliwości.</p>\r\n\r\n<h2>Google Analytics</h2>\r\n\r\n<p>Niniejsza witryna internetowa korzysta z Google Analytics, usługi analizy oglądalności stron internetowych udostępnianej przez Google, Inc. (“Google”). Google Analytics używa “cookies”, czyli plików tekstowych umieszczanych na komputerze użytkownika w celu umożliwienia witrynie przeanalizowania sposobu, w jaki użytkownicy z niej korzystają. Informacje generowane przez cookie na temat korzystania z witryny przez użytkownika (włącznie z jego adresem IP) będą przekazywane spółce Google i przechowywane przez nią na serwerach w Stanach Zjednoczonych.</p>\r\n\r\n<p>Google będzie korzystała z tych informacji w celu oceny korzystania z witryny przez użytkownika, tworzenia raportów dotyczących ruchu na stronach dla operatorów witryn oraz świadczenia innych usług związanych z ruchem na witrynach internetowych i korzystaniem z internetu. Google może również przekazywać te informacje osobom trzecim, jeżeli będzie zobowiązana to uczynić na podstawie przepisów prawa lub w przypadku, gdy osoby te przetwarzają takie informacje w imieniu Google. Google nie będzie łączyła adresu IP użytkownika z żadnymi innymi danymi będącymi w jej posiadaniu. Użytkownik może zrezygnować z cookies wybierając odpowiednie ustawienia na przeglądarce, jednak należy pamiętać, że w takim przypadku korzystanie z wszystkich funkcji witryny może okazać się niemożliwe Korzystając z niniejszej witryny internetowej użytkownik wyraża zgodę na przetwarzanie przez Google dotyczących go danych w sposób i w celach określonych powyżej.</p>\r\n\r\n<p>Użytkownik który nie wyraża zgody na działanie systemu Google Analytics powinien zastosować blokadę plików cookies.</p>\r\n\r\n<h2>W jaki sposób będziemy się z Tobą kontaktować?</h2>\r\n\r\n<p>Jeżeli zapisałeś się na nasz Newsletter, lub w inny sposób wyraziłeś zgodę na jego otrzymywanie, będziesz od nas otrzymywać drogą emailową nasz Newsletter.</p>\r\n\r\n<h2>Wykorzystanie ciasteczek (\"cookies\")</h2>\r\n\r\n<p>Nasza strona internetowa wykorzystuje ciasteczka, które służą identyfikacji Twojej przeglądarki podczas korzystania z naszej strony, abyśmy wiedzieli jaką stronę Ci wyświetlić. Ciasteczka nie zawierają żadnych danych osobowych.</p>\r\nPliki cookies wykorzystywane są w celu:\r\n\r\n<ul>\r\n	<li>dostosowania zawartości strony internetowej do indywidualnych potrzeb użytkownikach</li>\r\n	<li>tworzenia statystyk w celu badania funkcjonalności poszczególnych stron serwisu</li>\r\n	<li>utrzymywanie sesji użytkownika serwisu (po zalogowaniu) dzięki czemu użytkownik przy każdym przeładowaniu strony nie musi ponownie wpisywać loginu i hasła</li>\r\n	<li>dostarczania użytkownikom serwisu treści reklamowych bardziej dostosowanych do ich zainteresowań</li>\r\n</ul>\r\n\r\n<p>Pliki cookies nie powodują zmian konfiguracyjnych w urządzeniu lub oprogramowaniu zainstalowanym w urządzeniu Użytkownika.</p>\r\n\r\n<p>Użytkownik, który chce usunąć dotychczasowe pliki cookies powinien wybrać odpowiednie ustawienia w swojej przeglądarce internetowej lub usunąć pliki cookies ręcznie.</p>\r\n\r\n<h2>Zmiany naszej polityki prywatności.</h2>\r\n\r\n<p>Zastrzegamy sobie prawo zmiany powyższej polityki prywatności poprzez opublikowanie nowej polityki prywatności na tej stronie.</p>\r\n\r\n<h2>Kontakt</h2>\r\n\r\n<p>Dane zbiera firma: INTERIUM Strony i Aplikacje Internetowe Joanna Szelągowska, ul. Kościuszki 51/15 59-700 Bolesławiec, NIP: 612-167-48-70</p>\r\n\r\n<p>W razie dodatkowych pytań dotyczących ochrony prywatności, prosimy o kontakt korzystając z formularza kontaktowego na stronie kontaktowej.</p>\r\n</div>\r\n','nophoto.png',0.00,'','','','','polityka-prywatnosci','fullView.html','2016-12-28 13:01:10',0,0,1),(76,1,0,0,1,0,'Home','<p>ENGLISH</p>\r\n\r\n<section class=\"service\" id=\"service\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"main_service p_t__b textwhite\">\r\n<div class=\"head_title text-center textblack\">\r\n<h2>Witamy na Stronie BFZ</h2>\r\n\r\n<p>BFZ jest pionierem pod względem wprowadzania nowoczesnych technologii produkcji w branży pomocy drogowych do 3,5Tony. Firma rozwija własną myśl technologiczną, optymalizuje proces produkcyjny, wprowadza nowości techniczne. Zespół konstruktorów i technologów opracowuje innowacyjne rozwiązania konstrukcyjne.</p>\r\n\r\n<div class=\"separator\">&nbsp;</div>\r\n</div>\r\n\r\n<div class=\"col-sm-6\">\r\n<div class=\"single_service margin-top-40\">\r\n<div class=\"row\">\r\n<div class=\"col-xs-12\">\r\n<div class=\"single_text_icon text-center\"><img alt=\"\" src=\"/filemanager/files/grafika/zdj_1.jpg\" /><br />\r\n&nbsp;</div>\r\n</div>\r\n\r\n<div class=\"col-xs-12\">\r\n<div class=\"single_service_text_right textblack\">\r\n<h6>Przykładowy Tekst</h6>\r\n\r\n<p>Firma rozwija własną myśl technologiczną, optymalizuje proces produkcyjny, wprowadza nowości techniczne. Zespół konstruktorów i technologów opracowuje innowacyjne rozwiązania konstrukcyjne.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<!--End of col-sm-6 --></div>\r\n\r\n<div class=\"col-sm-6\">\r\n<div class=\"single_service margin-top-40\">\r\n<div class=\"row\">\r\n<div class=\"col-xs-12\">\r\n<div class=\"single_text_icon text-center\"><img alt=\"\" src=\"/filemanager/files/grafika/zdj_2.jpg\" /><br />\r\n&nbsp;</div>\r\n</div>\r\n\r\n<div class=\"col-xs-12\">\r\n<div class=\"single_service_text_right textblack\">\r\n<h6>Przykładowy Tekst</h6>\r\n\r\n<p>Firma r