n','<div class=\"head_title text-center\">\r\n<h2 style=\"text-align: center;\">Jakość i Technologia w Dobrej Cenie</h2>\r\n</div>\r\n\r\n<hr />\r\n<p style=\"text-align: center;\">Produkty BFZ FURGON to doskonała jakość i technologia, dostępne w dobrej cenie. Do produkcji naszych zabudów używane są wyłącznie maszyny CNC. Wśród produktów BFZ FURGON oferujemy zabudowy ścian bocznych, zabudowy podłogi w jednym elemencie, system szyn do zabezpieczenia ładunków, w ofercie także posiadamy ogrzewania postojowe firmy Webasto.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<div class=\"separator\">&nbsp;</div>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<div class=\"btgrid\">\r\n<div class=\"row row-1\">\r\n<div class=\"col col-md-4\">\r\n<div class=\"content\">\r\n<p><img alt=\"\" class=\"img-responsive\" src=\"/filemanager/files/grafika/furgon/furgon_zdj2.jpg\" /></p>\r\n\r\n<p style=\"text-align: justify;\">Do produkcji naszych zabudów wykorzystujemy nowoczesny i profesjonalny sprzęt, z pomocą którego frezowanie ploterem cnc wykonywane jest precyzyjnie – zgodnie z dokumentacją i specyfikacją techniczną.</p>\r\n</div>\r\n</div>\r\n\r\n<div class=\"col col-md-4\">\r\n<div class=\"content\">\r\n<p><img alt=\"\" class=\"img-responsive\" src=\"/filemanager/files/grafika/furgon/furgon_zdj3.jpg\" /></p>\r\n\r\n<p style=\"text-align: justify;\">Oferowany przez naszą firmę szeroki asortyment szyn gwarantuje bezpieczną podróż. Mamy odpowiednie szyny dla każdego typu pojazdu oraz każdego zastosowania. Wszystkie drążki rozporowe występują zarówno w wersji sztywnej, jak i teleskopowej. Drążki rozporowe mogą być stosowane w pozycji pionowej oraz poziomej, dzięki czemu łatwo dopasować je do żądanej przestrzeni.</p>\r\n</div>\r\n</div>\r\n\r\n<div class=\"col col-md-4\">\r\n<div class=\"content\">\r\n<p><img alt=\"\" class=\"img-responsive\" src=\"/filemanager/files/grafika/furgon/furgon_zdj1.jpg\" /></p>\r\n\r\n<p style=\"text-align: justify;\">Systemy ogrzewania postojowego Webasto są przeznaczone do każdego rodzaju samochodu. Urządzenia są testowane w ekstremalnych warunkach, znacznie bardziej wymagających niż te stosowane przez instytucje badawcze. W efekcie, w niezależnych testach ekspertów rynku motoryzacyjnego, samochodowe ogrzewania postojowe Webasto zajmuje najwyższe miejsca na podium.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n','b0003_4.jpg',0.00,'','','','','bfz-furgon','gridView-col-6-offset-3.html','2017-02-16 11:44:16',0,0,1),(80,1,0,0,2,0,'Kariera','',NULL,0.00,'','','','','kariera','fullView.html','2017-02-16 11:46:12',0,0,0),(81,1,0,0,2,0,'Oferta','<div class=\"head_title text-center\">\r\n<h2 style=\"text-align: center;\">Dajemy to co najlepsze</h2>\r\n</div>\r\n\r\n<hr />\r\n<p style=\"text-align: center;\">Produkty BFZ Sp. z o.o. to doskonała jakość i technologia, dostępne w dobrej cenie.</p>\r\n\r\n<p style=\"text-align: center;\">Do produkcji naszych platform używane są masywne i wytrzymałe profile z najlepszego gatunku aluminium.</p>\r\n\r\n<p style=\"text-align: center;\">Zapraszamy do zapoznania się z ofertą. Opis każdego produktu można znaleźć niżej.</p>\r\n','a0010_m.jpg',0.00,'','','','','oferta','gridView-col-6.html','2017-02-16 11:47:44',0,0,1),(82,1,0,0,3,0,'Home','',NULL,0.00,'','','','','home','homeView.html','2017-02-16 11:56:25',0,0,1),(83,1,0,81,2,0,'3,5 tony','<p style=\"text-align: center;\">Samochody typu Autotransporter przeznaczone są głównie do przewozu pojazdów osobowych.</p>\r\n\r\n<p style=\"text-align: center;\">Zastosowane w nich zawieszenie pneumatyczne pozawala na załadowanie praktycznie każdego samochodu wpływa ono także na jakość i bezpieczeństwo jazdy.</p>\r\n\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n\r\n<div class=\"btgrid\">\r\n<div class=\"row row-1\">\r\n<div class=\"col col-md-6\">\r\n<div class=\"content\">\r\n<h3><strong>Główne Cechy&nbsp;</strong></h3>\r\n\r\n<ul>\r\n	<li>Cała powierzchnia platformy jest odpowiednio frezowana po to by bezpiecznie wjeżdżać samochodami podczas opadów deszczu czy oblodzenia</li>\r\n	<li>Specjalistyczny profil boczny pozwala na bezpiecznie i szybkie zapięcie pasów transportowych.</li>\r\n	<li>Samochody są z powodzeniem wykorzystywane do przewozu pojazdów powypadkowych uszkodzonych mechanicznie oraz całych.</li>\r\n	<li>Dzięki systemowi zsuwanych najazdów jest możliwość transportowania np. Quadów, Motocykli , Kosiarek ogólnie wszystkich pojazdów o wąskim rozstawie osi</li>\r\n</ul>\r\n</div>\r\n</div>\r\n\r\n<div class=\"col col-md-6\">\r\n<div class=\"content\">\r\n<p><a class=\"powieksz\" href=\"/filemanager/files/grafika/produkty/opis35.jpg\"><img alt=\"\" class=\"img-responsive\" src=\"/filemanager/files/grafika/produkty/opis35.jpg\" /></a></p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n\r\n<h3>&nbsp;</h3>\r\n\r\n<ul>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3 style=\"text-align: center;\"><strong>Atutem naszych pojazdów jest mocna i zwarta konstrukcja, co sprzyja pracom w trudnych warunkach drogowych.</strong></h3>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>[GALERIA]</p>\r\n','b0003.jpg',0.00,'','','','','oferta-35-tony','fullView.html','2017-02-16 14:08:31',0,0,1),(84,1,0,81,2,0,'5 ton','<p style=\"text-align: center;\">Samochody typu Autotransporter przeznaczone są głównie do przewozu pojazdów osobowych oraz dostawczych.<br />\r\nOdpowiednio wyprofilowana rama pojazdu oraz zastosowane w nim zawieszenie pneumatyczne pozawala na załadowanie praktycznie każdego samochodu wpływa ono także na jakość i bezpieczeństwo jazdy.</p>\r\n\r\n<p style=\"text-align: center;\">&nbsp;</p>\r\n\r\n<div class=\"btgrid\">\r\n<div class=\"row row-1\">\r\n<div class=\"col col-md-6\">\r\n<div class=\"content\">\r\n<h3><strong>Główne Cechy&nbsp;</strong></h3>\r\n\r\n<ul>\r\n	<li>Cała powierzchnia platformy jest odpowiednio frezowana po to by bezpiecznie wjeżdżać samochodami podczas opadów deszczu czy oblodzenia</li>\r\n	<li>Specjalistyczny profil boczny pozwala na bezpiecznie i szybkie zapięcie pasów transportowych.</li>\r\n	<li>Samochody są z powodzeniem wykorzystywane do przewozu pojazdów powypadkowych uszkodzonych mechanicznie oraz całych.</li>\r\n	<li>Dzięki systemowi zsuwanych najazdów jest możliwość transportowania np. Quadów, Motocykli , Kosiarek ogólnie wszystkich pojazdów o wąskim rozstawie osi</li>\r\n	<li>Atutem pojazdów o dopuszczalnej masie całkowitej 5Ton jest podwyższona wytrzymałość zawieszenia oraz zwiększona ładowność.</li>\r\n</ul>\r\n</div>\r\n</div>\r\n\r\n<div class=\"col col-md-6\">\r\n<div class=\"content\">\r\n<p><a class=\"powieksz\" href=\"/filemanager/files/grafika/produkty/opis.jpg\"><img alt=\"\" class=\"img-responsive\" src=\"/filemanager/files/grafika/produkty/opis_m.jpg\" /></a></p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n\r\n<h3>&nbsp;</h3>\r\n\r\n<ul>\r\n</ul>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h3 style=\"text-align: center;\"><strong>Atutem naszych pojazdów jest mocna i zwarta konstrukcja, co sprzyja pracom w trudnych warunkach drogowych.</strong></h3>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>[GALERIA]</p>\r\n','5ton.jpg',0.00,'','','','','oferta-5-ton','fullView.html','2017-02-16 15:24:46',0,0,1),(85,1,0,88,2,1,'Na zewnątrz','','a0017_4.jpg',0.00,'','','','','galeria-na-zewnatrz','galleryView.html','2017-02-22 11:07:51',0,0,1),(86,1,0,88,2,1,'Elementy','','a0045_1.jpg',0.00,'','','','','galeria-elementy','galleryView.html','2017-02-22 11:08:53',0,0,1),(87,1,0,88,2,1,'Wnętrze','','a0026_3.jpg',0.00,'','','','','galeria-wnetrze','galleryView.html','2017-02-22 11:10:07',0,0,1),(88,1,0,78,2,1,'Mercedes 5 Ton','','a0008_2.jpg',0.00,'','','','','galeria-mercedes','gridView.html','2017-02-23 12:57:57',2,0,1),(89,1,0,78,2,1,'Fiat','','a0018_2.jpg',0.00,'','','','','galeria-fiat','gridView.html','2017-02-23 12:58:09',3,0,1),(90,1,0,78,2,1,'Mercedes 3,5 Tony','','a0021_1.jpg',0.00,'','','','','galeria-opel','gridView.html','2017-02-23 12:58:17',1,0,1),(91,1,0,0,2,0,'Home - Kopiuj','<section class=\"service\" id=\"service\">\r\n<div class=\"container\">\r\n<div class=\"row\">\r\n<div class=\"main_service p_t__b textwhite\">\r\n<div class=\"head_title text-center textblack\">\r\n<h2>Witamy na Stronie BFZ</h2>\r\n\r\n<p>BFZ jest pionierem pod względem wprowadzania nowoczesnych technologii produkcji w branży pomocy drogowych do 3,5Tony. Firma rozwija własną myśl technologiczną, optymalizuje proces produkcyjny, wprowadza nowości techniczne. Zespół konstruktorów i technologów opracowuje innowacyjne rozwiązania konstrukcyjne.</p>\r\n\r\n<div class=\"separator\">&nbsp;</div>\r\n</div>\r\n<!-- B4 -->\r\n\r\n<div class=\"col-sm-6\">\r\n<div class=\"single_service margin-top-40\">\r\n<div class=\"row\">\r\n<div class=\"col-sm-12\">\r\n<div class=\"single_text_icon text-center\"><img alt=\"\" src=\"/filemanager/files/grafika/home/img4.jpg\" /></div>\r\n</div>\r\n&nbsp;\r\n\r\n<div class=\"col-sm-12\">\r\n<div class=\"single_service_text_right textblack\">\r\n<h6>Firma</h6>\r\n\r\n<p style=\"text-align: justify;\">Firma jest od początku istnienia związana z branżą motoryzacyjną, na potrzeby której projektuje i produkuje zabudowy aluminiowe do przewozu pojazdów. Firma posiada referencje w kręgu krajów Europy.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<!-- B4 --><!-- B1 -->\r\n\r\n<div class=\"col-sm-6\">\r\n<div class=\"single_service margin-top-40\">\r\n<div class=\"row\">\r\n<div class=\"col-sm-12\">\r\n<div class=\"single_text_icon text-center\"><img alt=\"\" src=\"/filemanager/files/grafika/home/img1.jpg\" /></div>\r\n</div>\r\n&nbsp;\r\n\r\n<div class=\"col-sm-12\">\r\n<div class=\"single_service_text_right textblack\">\r\n<h6>Proces produkcyjny</h6>\r\n\r\n<p style=\"text-align: justify;\">Spawacze BFZ jedni z najlepszych fachowców techniki połączeń spawanych,&nbsp; profesjonaliści&nbsp; wykonujący spoiny łączenia metodami Tig, Mig. Uczciwość, rzetelność i profesjonalne podejście do każdego zadania to główne cechy naszego zespołu produkcyjnego.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<!-- B1 --><!-- B2 -->\r\n\r\n<div class=\"col-sm-6\">\r\n<div class=\"single_service margin-top-40\">\r\n<div class=\"row\">\r\n<div class=\"col-sm-12\">\r\n<div class=\"single_text_icon text-center\"><img alt=\"\" src=\"/filemanager/files/grafika/home/img2.jpg\" /></div>\r\n</div>\r\n&nbsp;\r\n\r\n<div class=\"col-sm-12\">\r\n<div class=\"single_service_text_right textblack\">\r\n<h6>Materiały do produkcji</h6>\r\n\r\n<p style=\"text-align: justify;\">Do produkcji platform używamy wyłącznie <strong>aluminium i stali nierdzewnej</strong> dzięki takiemu rozwiązaniu produkty nasze są przez cały okres użytkowania bez śladów rdzy i korozji.&nbsp;</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<!-- B2 --><!-- B3 -->\r\n\r\n<div class=\"col-sm-6\">\r\n<div class=\"single_service margin-top-40\">\r\n<div class=\"row\">\r\n<div class=\"col-sm-12\">\r\n<div class=\"single_text_icon text-center\"><img alt=\"\" src=\"/filemanager/files/grafika/home/img3.jpg\" /></div>\r\n</div>\r\n&nbsp;\r\n\r\n<div class=\"col-sm-12\">\r\n<div class=\"single_service_text_right textblack\">\r\n<h6>Projektowanie</h6>\r\n\r\n<p style=\"text-align: justify;\">Zespół konstruktorów i technologów opracowuje innowacyjne rozwiązania konstrukcyjne.Dzięki temu jesteśmy pionierami w wdrażaniu praktycznych rozwiązań dla użytkownika pojazdu.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<!-- B3 --></div>\r\n</div>\r\n</div>\r\n</section>\r\n','',0.00,'','','','','home','homeView.html','2017-02-23 14:28:56',1000,0,0),(92,1,0,0,2,0,'Impressum','<div class=\"btgrid\">\r\n<div class=\"row row-1\">\r\n<div class=\"col col-md-6\">\r\n<div class=\"content\">\r\n<p><strong>BFZ Sp. z o.o.</strong><br />\r\nul. Przemysłowa 11<br />\r\n59-700 Bolesławiec<br />\r\nPOLSKA<br />\r\n<br />\r\nSR Wrocław - Fabryczna IX Wydział&nbsp;<br />\r\nKapitał Zakładowy 50&nbsp;000 zł<br />\r\n<br />\r\n<strong>KRS</strong>: 0000478678<br />\r\n<strong>NIP:</strong> 8982222053<br />\r\n<strong>NIP EU:</strong> PL8982222053<br />\r\n<strong>REGON:</strong> 363491910</p>\r\n</div>\